import React from 'react';
import { Container, Typography } from '@mui/material';

const HomePage = () => (
  <Container sx={{ mt: 4 }}>
    <Typography variant="h4">Welcome to ExamsAI</Typography>
    <Typography>Find study materials and info for all competitive exams in India.</Typography>
  </Container>
);

export default HomePage;
